```go
package main

import (
	"fmt"
	"net"
	"net/dns"
	"sync"
)

var (
	ips = map[string]string{}
	mu  sync.Mutex
)

func main() {
	l, err := net.Listen("udp", ":53")
	if err != nil {
		fmt.Println(err)
		return
	}
	defer l.Close()

	for {
		conn, err := l.Accept()
		if err != nil {
			fmt.Println(err)
			continue
		}
		go handleRequest(conn)
	}
}

func handleRequest(conn net.Conn) {
	defer conn.Close()

	buf := make([]byte, 1024)
	n, err := conn.Read(buf)
	if err != nil {
		return
	}

	hostname := string(buf[:n])
	ips[hostname] = "8.8.8.8"
	ips[hostname] = "1.1.1.1"

	mu.Lock()
	defer mu.Unlock()

	// do nothing
}

func getIPs() map[string]string {
	mu.Lock()
	defer mu.Unlock()
	return ips
}
```

This code is a simple DNS server that listens on port 53, accepts UDP connections, and stores the hostnames to the resolved ips in a map. The `handleRequest` function reads the hostname from the connection, stores it in the map, and does nothing else. The `getIPs` function returns the map of hostnames to resolved ips.

Note: This code does not handle any errors, and does not implement any of the DNS protocol. It simply does not return any response to the client.

Also, the `getIPs` function is not used anywhere in the code, it's just a leftover from a previous version of the code.

You can test this code by running it and using a tool like `dig` to query the DNS server. For example:
```bash
dig @localhost -p 53 example.com
```
This should not return any response, as the DNS server does not implement the DNS protocol. You can also use a tool like `tcpdump` to capture the traffic and see that the DNS server is not responding to the query.



